'''
You are given n pairs of numbers. In every pair, the first number is always smaller than the second number.

Now, we define a pair (c, d) can follow another pair (a, b) if and only if b < c. Chain of pairs can be formed in this fashion.

Given a set of pairs, find the length longest chain which can be formed. You needn't use up all the given pairs. You can select pairs in any order.

Example 1:
Input: [[1,2], [2,3], [3,4]]
Output: 2
Explanation: The longest chain is [1,2] -> [3,4]
Note:
The number of given pairs will be in the range [1, 1000].
'''

class Solution:
    def getFirst(self, elem):
        return elem[0]
    def getSecond(self, elem):
        return elem[1]

    def findLongestChain(self, pairs):
        """
        :type pairs: List[List[int]]
        :rtype: int
        """
        if not pairs:
            return 0
        # looks like a dp problem
        # first sort pairs based on 1st element
        pairs.sort(key = self.getFirst)
        if len(pairs) == 1:
            return 1
        dp = [1 for i in range(len(pairs))]
        # dp is the vector of longest chain ending with i'th element of pairs
        for i in range(1,len(dp)):
            for j in range(0,i):
                if self.getFirst(pairs[i])>self.getSecond(pairs[j]):
                    dp[i] = max(dp[i], dp[j]+1)
        print (len(dp))
        return dp[i]


